import mongoose from 'mongoose';

const MealSchema = new mongoose.Schema({
  user: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'users'
  },
  calories: {
    type: String
  },
  fat: {
    type: String
  },
  date: {
    type: Date,
    default: Date.now
  }
});

let Meal = mongoose.models.Meal || mongoose.model('meal', MealSchema);

export default Meal;
